import {useAuth} from '../utils/auth';
import { useNavigate } from 'react-router-dom';
import { Children } from 'react';
export const RequireAuth = ({children}) =>
{
    const auth = useAuth()
    let navigate = useNavigate();

    if (!auth.user)
    {
        return navigate('/login');
        
    }

    return children;
}
